import React from "react";
import { useNavigate } from "react-router-dom";
import './UserProfile.css'; // âœ… Connect your custom styles

export default function UserProfile() {
  const navigate = useNavigate();
  const user = JSON.parse(localStorage.getItem("user"));

  if (!user) {
    return (
      <div className="container my-5">
        <div className="alert alert-danger text-center">
          User not logged in.
        </div>
      </div>
    );
  }

  const handleLogout = () => {
    localStorage.removeItem("user");
    navigate("/login");
  };

  return (
    <div className="container my-5">
      <h3 className="mb-4 text-primary">ðŸ‘¤ Account Overview</h3>

      <div className="profile-card shadow-sm p-4 rounded">
        <div className="mb-3">
          <label className="profile-label">Name</label>
          <div className="profile-value">{user.name}</div>
        </div>
        <div className="mb-3">
          <label className="profile-label">Email</label>
          <div className="profile-value">{user.email}</div>
        </div>
        <div className="mb-3">
          <label className="profile-label">Role</label>
          <div className="profile-value">{user.role}</div>
        </div>
        <div className="mt-4">
          <button className="btn btn-outline-danger px-4" onClick={handleLogout}>
            ðŸ”“ Logout
          </button>
        </div>
      </div>
    </div>
  );
}
